import React from 'react';
import {
  Calculator,
  Settings,
  LogOut,
  User,
  ChevronDown,
  RefreshCw,
  Hash,
  Code,
  Calculator as CalcIcon,
} from 'lucide-react';

// Format Indicator Component
const FormatIndicator = ({ format }) => {
  const getFormatIcon = () => {
    switch (format) {
      case 'binary':
        return <Code className="w-4 h-4" />;
      case 'hexadecimal':
        return <Hash className="w-4 h-4" />;
      case 'polynomial':
        return <CalcIcon className="w-4 h-4" />;
      default:
        return null;
    }
  };

  return (
    <div className="inline-flex items-center px-2 py-1 rounded-md bg-gray-800 text-gray-300 text-xs font-medium">
      {getFormatIcon()}
      <span className="ml-1 capitalize">{format}</span>
    </div>
  );
};

const AuthenticatedDashboard = ({ onLogout, userName }) => {
  const [inputFormat, setInputFormat] = React.useState('polynomial');
  const [outputFormat, setOutputFormat] = React.useState('polynomial');
  const [activeInput, setActiveInput] = React.useState('first');
  const [input, setInput] = React.useState({ first: '', second: '', modulo: '' });
  const [result, setResult] = React.useState(null);

  const formats = [
    { id: 'binary', label: 'Binary' },
    { id: 'hexadecimal', label: 'Hexadecimal' },
    { id: 'polynomial', label: 'Polynomial' },
  ];

  const handleCalculate = () => {
    setResult({
      operation: 'Sample Operation',
      value: `Result in ${outputFormat}`,
    });
  };

  const handleClear = () => {
    setInput({ first: '', second: '', modulo: '' });
    setResult(null);
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <header className="flex justify-between items-center p-4 bg-gray-800">
        <span className="text-xl font-bold">CryptoCalc</span>
        <div className="flex items-center gap-3">
          <span>{userName}</span>
          <button onClick={onLogout} className="px-4 py-2 bg-red-500 rounded-md">
            <LogOut className="w-5 h-5" />
          </button>
        </div>
      </header>

      <main className="p-6 max-w-4xl mx-auto space-y-6">
        {/* Format Selection */}
        <div className="flex justify-between items-center">
          <div>
            <h2 className="text-lg font-medium">Select Input & Output Formats</h2>
            <div className="flex gap-4 mt-2">
              <div>
                <label className="block text-sm mb-1">Input Format</label>
                <div className="flex gap-2">
                  {formats.map((format) => (
                    <button
                      key={format.id}
                      onClick={() => setInputFormat(format.id)}
                      className={`px-3 py-1 rounded-md ${
                        inputFormat === format.id
                          ? 'bg-blue-600 text-white'
                          : 'bg-gray-700 text-gray-300'
                      }`}
                    >
                      {format.label}
                    </button>
                  ))}
                </div>
              </div>
              <div>
                <label className="block text-sm mb-1">Output Format</label>
                <div className="flex gap-2">
                  {formats.map((format) => (
                    <button
                      key={format.id}
                      onClick={() => setOutputFormat(format.id)}
                      className={`px-3 py-1 rounded-md ${
                        outputFormat === format.id
                          ? 'bg-purple-600 text-white'
                          : 'bg-gray-700 text-gray-300'
                      }`}
                    >
                      {format.label}
                    </button>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Input Fields */}
        <div className="space-y-4">
          {['first', 'second', 'modulo'].map((field) => (
            <div key={field} className="flex items-center gap-3">
              <input
                id={field}
                type="text"
                value={input[field]}
                onChange={(e) => setInput({ ...input, [field]: e.target.value })}
                placeholder={`Enter ${field} value`}
                className="flex-1 bg-gray-800 px-4 py-2 rounded-md focus:outline-none border border-gray-700"
              />
              <FormatIndicator format={inputFormat} />
            </div>
          ))}
        </div>

        {/* Result Section */}
        <div className="p-4 bg-gray-800 rounded-md">
          <h3 className="text-lg mb-2">Result</h3>
          {result ? (
            <div>
              <p className="text-gray-300">{result.value}</p>
              <FormatIndicator format={outputFormat} />
            </div>
          ) : (
            <p className="text-gray-500">No result yet. Enter values and click calculate.</p>
          )}
        </div>

        {/* Actions */}
        <div className="flex justify-between">
          <button
            onClick={handleCalculate}
            className="px-6 py-2 bg-green-600 rounded-md hover:bg-green-500"
          >
            Calculate
          </button>
          <button
            onClick={handleClear}
            className="px-6 py-2 bg-red-600 rounded-md hover:bg-red-500"
          >
            Clear
          </button>
        </div>
      </main>
    </div>
  );
};

export default AuthenticatedDashboard;
